function toggleAnswerTypeDivs(type_div) {
  var e = document.getElementById(type_div.dataset.answerType);
  if (e.style.display == 'block' || e.style.display=='') {
    e.style.display = 'none';
  } else {
    e.style.display = 'block';
  }
};


